import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// react component for creating beautiful carousel
import Carousel from "react-slick";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
// @material-ui/icons
import Share from "@material-ui/icons/Share";
import ShoppingCart from "@material-ui/icons/ShoppingCart";
// core components
import Header from "components/Header/Header.js";
import Button from "components/CustomButtons/Button.js";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Card from "components/Card/Card.js";
import CardBody from "components/Card/CardBody.js";
import CustomInput from "components/CustomInput/CustomInput.js";

import headersStyle from "assets/jss/material-kit-pro-react/views/sectionsSections/headersStyle.js";

import bg12 from "assets/img/transfer/beach2.jpg";

const useStyles = makeStyles(headersStyle);

export default function SectionHeaders({ ...rest }) {
    React.useEffect(() => {
        window.scrollTo(0, 0);
        document.body.scrollTop = 0;
      });
    const classes = useStyles();
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      autoplay: false
    };
    return (
      // we've set the className to cd-section so we can make smooth scroll to it
      <div className="homepage" {...rest}>
        {/* HEADER 1 START */}
        <div>
          <Header
            absolute
            brand="doubleshotblog"
            color="transparent"
            fixed
            changeColorOnScroll={{
                height: 300,
                color: "default"
              }}
            links={
              <div className={classes.collapse}>
                <List className={classes.list + " " + classes.mlAuto}>
                  <ListItem className={classes.listItem}>
                    <Button
                      href=""
                      className={classes.navLink}
                      onClick={e => e.preventDefault()}
                      color="transparent"
                    >
                      Home
                    </Button>
                  </ListItem>
                  <ListItem className={classes.listItem}>
                    <Button
                      href=""
                      className={classes.navLink}
                      onClick={e => e.preventDefault()}
                      color="transparent"
                    >
                      Blog
                    </Button>
                  </ListItem>
                  <ListItem className={classes.listItem}>
                    <Button
                      href="#pablo"
                      className={classes.navLink}
                      onClick={e => e.preventDefault()}
                      color="transparent"
                    >
                      Interests
                    </Button>
                  </ListItem>
                  <ListItem className={classes.listItem}>
                    <Button
                      href="#pablo"
                      className={classes.navLink}
                      onClick={e => e.preventDefault()}
                      color="transparent"
                    >
                      About Me
                    </Button>
                  </ListItem>
                </List>
                <List className={classes.list + " " + classes.mlAuto}>
                <ListItem className={classes.listItem}>
                    <Button
                      color="transparent"
                      href=""
                      target="_blank"
                      className={classes.navLink + " " + classes.navLinkJustIcon}
                    >
                      <i className={"fab fa-youtube"} />
                    </Button>
                  </ListItem>
                  <ListItem className={classes.listItem}>
                    <Button
                      color="transparent"
                      href=""
                      target="_blank"
                      className={classes.navLink + " " + classes.navLinkJustIcon}
                    >
                      <i className={"fab fa-instagram"} />
                    </Button>
                  </ListItem>
                </List>
              </div>
            }
          />
          <div
            className={classes.pageHeader}
            style={{ backgroundImage: `url("${bg12}")` }}
          >
            <div className={classes.container}>
              <GridContainer>
                <GridItem xs={12} sm={6} md={6}>
                  <h1 className={classes.title}>doubleshotblog</h1>
                  <h4>
                    Hi I'm Kenny and this is where I share my thoughts,
                    experiences, and insight on anything and everything in my life.
                  </h4>
                  <br />
                  {/* <Button
                    color="default"
                    size="lg"
                    href=""
                    target="_blank"
                    rel=""
                  >
                    Blog
                  </Button> */}
                </GridItem>
                {/* <GridItem xs={12} sm={5} md={5} className={classes.mlAuto}>
                  <div className={classes.iframeContainer}>
                    <iframe
                      height="250"
                      src="https://open.spotify.com/embed/playlist/0IflNcQnmivx1v0TDCqS9m"
                      frameBorder="0"
                      allow="encrypted-media"
                      allowFullScreen=""
                      title="Tunessa"
                    />
                  </div>
                </GridItem> */}
              </GridContainer>
            </div>
          </div>
        </div>
        {/* HEADER 1 END */}
    </div>
  );
}
